Apply the properties of operations to generate equivalent expressions. For example, apply the distributive property to the expression 3(2 + x) to
produce the equivalent expression 6 + 3x; apply the distributive property to the expression 24x + 18y to produce the equivalent expression 6 (4x + 3y);
apply properties of operations to y + y + y to produce the equivalent expression 3y

EC44742865A646959F9973E16199A953.description:
Understand the concept of a unit rate a/b associated with a ratio a:b with b ≠ 0 (b not equal to zero), and use rate language in the context of a ratio
relationship. For example, "This recipe has a ratio of 3 cups of flour to 4 cups of sugar, so there is 3/4 cup of flour for each cup of sugar." "We paid $75
for 15 hamburgers, which is a rate of $5 per hamburger." (Expectationsfor unit rates in this grade are limited to non-complex fractions.)
